styles:
.sky-radio-wrapper {
  display: inline-block;
  margin-bottom: 5px;
  cursor: pointer;
}

.sky-radio-wrapper input {
  opacity: 0;
  position: absolute;
  height: 22px;
  width: 22px;
  margin: 0;
  padding: 0;
  cursor: pointer;
}

.sky-radio {
  border-top: 1px solid #cdcfd2;
  border-bottom: 1px solid #cdcfd2;
  border-left: 1px solid #cdcfd2;
  border-right: 1px solid #cdcfd2;
  cursor: pointer;
  display: inline-block;
  height: 22px;
  margin: 0;
  padding: 0;
  vertical-align: middle;
  width: 22px;
  text-align: center;
  font-size: 15px;
  border-radius: 50%;
  line-height: 19px;
}

.sky-radio-wrapper input:hover + .sky-radio {
  border: 2px solid #007ca6;
}

.sky-radio-wrapper input:checked + .sky-radio {
  background-color: #007ca6;
  border-color: #007ca6;
  border-width: 1px;
}

.sky-radio-wrapper input:checked + .sky-radio:before {
  color: #ffffff;
  content: "\f00c";
  font-family: FontAwesome;
  font-size: 13px;
}

.sky-radio-wrapper input:disabled + .sky-radio {
  background-color: #eeeeef;
  border-top: 1px solid #e2e3e4;
  border-bottom: 1px solid #e2e3e4;
  border-left: 1px solid #e2e3e4;
  border-right: 1px solid #e2e3e4;
  cursor: default;
}

.sky-radio-wrapper input:focus + .sky-radio {
  outline: thin dotted;
  outline: -webkit-focus-ring-color auto 5px;
}

